import React from 'react'
import cx from 'classnames'
import {NavLink} from 'react-router-dom'

import Panel from './Panel'

const Navbar = () => {
  const activeClass = 'font-bold'
  const pendingClass = 'font-bold'

  return (
    <Panel className="sticky top-0 overflow-y-scroll flex flex-col item-start">
      <NavLink
        to="/"
        className={({isActive, isPending}) => cx(
          isPending ? pendingClass : isActive ? activeClass : '',
          'text-blue-500'
        )}
        style={({isActive, isPending}) => ({
          color: isPending ? 'red' : isActive ? 'green' : 'blue'
        })}
      >
        Buttons
      </NavLink>
      <NavLink
        to="/accordion"
        className={({isActive, isPending}) => cx(
          isPending ? pendingClass : isActive ? activeClass : '',
          'text-blue-500'
        )}
        style={({isActive, isPending}) => ({
          color: isPending ? 'red' : isActive ? 'green' : 'blue'
        })}
      >
        Accordion
      </NavLink>
      <NavLink
        to="/dropdown"
        className={({isActive, isPending}) => cx(
          isPending ? pendingClass : isActive ? activeClass : '',
          'text-blue-500'
        )}
        style={({isActive, isPending}) => ({
          color: isPending ? 'red' : isActive ? 'green' : 'blue'
        })}
      >
        Dropdown
      </NavLink>
      <NavLink
        to="/badge"
        className={({isActive, isPending}) => cx(
          isPending ? pendingClass : isActive ? activeClass : '',
          'text-blue-500'
        )}
        style={({isActive, isPending}) => ({
          color: isPending ? 'red' : isActive ? 'green' : 'blue'
        })}
      >
        Badge
      </NavLink>
    </Panel>
  )
}

export default Navbar
